import "./App.css";
import { useState } from "react";

const List = () => {
  const [age, setAge] = useState("");

  const onInputChange = () => {
    setAge(document.querySelector("input").value);
  };

  const onButtonAlermName = () => {
    return alert(age);
  };

  return (
    <>
      Ride here your name: <input type="text" onChange={onInputChange} />
      <button onClick={onButtonAlermName}>Submit</button>
    </>
  );
};

function App() {
  return (
    <>
      <List />
    </>
  );
}

export default App;
